The Pure White Land: Kazakhstan

Nature Documentary hosted by Katie Adler, published by NHK broadcasted as part of NHK Great Nature series in 2013 - English narration


Information
------------------------------

Experience the wonders of our incredible planet. Great Nature is an entirely new kind of natural history series. It introduces some of Earth's most stunning vistas, shows how they were created, and reveals nature's marvels in a style that's bursting with rich detail. Some of the natural wonders highlighted are a mysterious world of rocks and stones in China, the dramatic thawing of a mighty Siberian river, an exotic jungle in Papua New Guinea, and the world's largest island comprised only of sand in Australia. Different regions from around the world have been explored to find spectacular footage of amazing natural phenomena that have never been seen before.
Kazakhstan is a vast nation with dramatic and unexpected landscapes. One of them is the chalk lands--snow-white mountains with towering cliffs made of pure chalk. This spectacular landscape is little known outside Kazakhstan, breathtaking white vistas with unusually shaped rocks at the eastern end of the Caspian Sea. The mystery of their pure whiteness is now revealed.

